import React from 'react'
import { Container, Row, Col } from "reactstrap";
import './Footer.css'

import {Link} from 'react-router-dom';
import logo from "../../assets/images/Trackway.png";

const quick_link = [
  {
    path: "/home",
    display: "Home",
  },

  {
    path: "/about",
    display: "About",
  },

  {
    path: "/tours",
    display: "Tours",
  }
];


const quick_link2 = [
  {
    path: "/Gallery",
    display: "Home",
  },

  {
    path: "/login",
    display: "About",
  },

  {
    path: "/register",
    display: "Tours",
  }
];

const Footer = () => {
  return (
   <section>
    <Container>
      <Row>
        <Col lg='3'>
          <div className="logo">
            <img src={logo} alt="" />
            <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Facere, voluptatibus.</p>

            <div className="social d-flex align-items-center gap-4"></div>
            <span>
              <Link to ='#'>
              <i class="ri-youtube-fill"></i>
              </Link>
            </span>

            <span>
              <Link to ='#'>
              <i class="ri-facebook-fill"></i>
              </Link>
            </span>

            <span>
              <Link to ='#'>
              <i class="ri-github-fill"></i>
              </Link>
            </span>
          </div>
        </Col>
      </Row>
    </Container>
   </section>
  )
}

export default Footer
